● 量感あふれる新設計ワイドバスレフとゆとりのある筐体で実現する高音質再生。● 最大出力4W+4W、大口径40mmスピーカーが臨場感のある豊かな低音を実現。● 使い勝手の良いフロントボリューム一体型電源スイッチを採用。● ヘッドホン端子を前面に搭載し、パソコン接続時のプラグの差し換えが不要。● ポータブルプレーヤーやパソコンへの接続に便利な0.8mの入力コードを用意。<!-- お気に入りボタン対応　start　-->
