折りたたんでスマートに高音質を持ち運べるラウンドフォルムのコンパクトスピーカー。● 大口径φ50mmスピーカーユニットで高音質再生。小型ボディに大口径のφ50mmスピーカーユニットを2個搭載しています。見た目以上に迫力のある高音質再生がお楽しみいただけます。● 最大出力160mW＋160mWのアンプを内蔵。大口径スピーカーを活かしきるアンプを内蔵しました。手のひらサイズながら、コストパフォーマンスの高いサウンドが特長です。● 電池がなくなっても使用できるパッシブ機能採用。電池がなくなってしまった場合でも、補助的に使用することができるパッシブ機能を搭載。電源OFFの状態で接続機器のアンプから電源供給を行なえます。<!-- お気に入りボタン対応　start　-->
